import React from 'react';

export default function About (){

    return (
        <div id="about" className='about'>
            <div className='aboutContainer'>                
                <img className='aboutImg' src='dogPicture1.jpg'></img>
                
                <p className='aboutP'><span className='bold'>Meet your pet's new best friend!</span>Hi, I’m Abigail! I’ve been caring for dogs for over 10 years, with hands-on experience in grooming, training, and providing top-notch pet sitting. Whether your pup needs a quick walk, structured training, or a comfortable place to stay while you’re away, I’ve got you covered.
                At BarkNBoard, I treat every pet like my own—ensuring they feel safe, happy, and loved. Let’s make sure your furry friend has the care they deserve!
                </p>
                </div>

        </div>
    );
}
